import { Flex, Text } from "@chakra-ui/react";
import React from "react";

const Index = () => {
  return (
    <Flex
      flexDir="row"
      justifyContent="center"
      alignItems="center"
      position="relative"
      w="100%"
      h="100%"
      maxH="500px"
    >
      <Text fontSize="3xl" as="h1" fontWeight="700">
        I'm Shaun Mak
      </Text>
    </Flex>
  );
};

export default Index;
